import './App.css'
import * as React from 'react';

import Gender from './dropdowns/gender.tsx'; // Import the TypeScript version of Gender

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedGender: '', // Initialize selectedGender state
    };
  }

  // Handle gender selection
  handleSelectGender = (selectedOption) => {
    this.setState({ selectedGender: selectedOption.value });
  };

  // Handle form submission
  handleSubmit = () => {
    const { selectedGender } = this.state;
    console.log('Selected gender:', selectedGender);
    // Add further logic for form submission
  };

  render() {
    /* eslint-disable no-unused-vars */
    const { selectedGender } = this.state;
    /* eslint-enable no-unused-vars */

    return (
      <div className="App">
        <h1>Hello Name Generator</h1>
        {/* Use the TypeScript version of Gender component */}
        <Gender onSelectGender={this.handleSelectGender} />
        {/* Add other dropdowns and form elements */}
        <button onClick={this.handleSubmit}>Submit</button>
      </div>
    );
  }
}

export default App;
